import { useState } from "react";
import Navbar from "../../components/Navbar";
import Footer from "../../components/Footer";
import ProjectCard from "../../components/ProjectCard";
import { Input } from "../../components/ui/input";
import { Button } from "../../components/ui/button";
import {
 Select,
 SelectContent,
 SelectItem,
 SelectTrigger,
 SelectValue,
} from "../../components/ui/select";
import { Search, Filter } from "lucide-react";

const Projects = () => {
 const [searchQuery, setSearchQuery] = useState("");
 const [selectedCategory, setSelectedCategory] = useState("all");

 const allProjects = [
  {
   id: "1",
   title: "Explainable AI for Healthcare Diagnostics",
   description:
    "Developing models that provide human-interpretable explanations for their predictions in medical diagnostics.",
   category: "AI",
   university: "MIT School of Engineering, Pune",
   members: 3,
   publishDate: "Nov 21, 2024",
   views: 1250,
  },
  {
   id: "2",
   title: "Edge Computing Cloud Integration",
   description:
    "Integrating edge computing with cloud infrastructure for reduced latency in real-time applications.",
   category: "Cloud",
   university: "Stanford University",
   members: 2,
   publishDate: "Nov 22, 2024",
   views: 890,
  },
  {
   id: "3",
   title: "Blockchain Supply Chain System",
   description:
    "Decentralized supply chain management using blockchain technology for transparency.",
   category: "Blockchain",
   university: "Oxford University",
   members: 4,
   publishDate: "Nov 20, 2024",
   views: 1540,
  },
  {
   id: "4",
   title: "Advanced Anomaly Detection",
   description:
    "Machine learning techniques for detecting anomalies in complex datasets.",
   category: "AI",
   university: "Carnegie Mellon University",
   members: 3,
   publishDate: "Nov 19, 2024",
   views: 980,
  },
  {
   id: "5",
   title: "Smart Contract Audit Platform",
   description:
    "Automated security auditing for smart contracts on Ethereum blockchain.",
   category: "Blockchain",
   university: "Berkeley University",
   members: 2,
   publishDate: "Nov 18, 2024",
   views: 1120,
  },
  {
   id: "6",
   title: "Multi-Cloud Orchestration Tool",
   description:
    "Unified management interface for deploying applications across multiple cloud providers.",
   category: "Cloud",
   university: "MIT",
   members: 4,
   publishDate: "Nov 17, 2024",
   views: 760,
  },
  {
   id: "7",
   title: "Natural Language Processing for Legal Documents",
   description:
    "AI-powered analysis and summarization of legal texts and contracts.",
   category: "AI",
   university: "Harvard University",
   members: 3,
   publishDate: "Nov 16, 2024",
   views: 1340,
  },
  {
   id: "8",
   title: "Decentralized Identity Management",
   description:
    "Blockchain-based system for secure and private digital identity verification.",
   category: "Blockchain",
   university: "ETH Zurich",
   members: 3,
   publishDate: "Nov 15, 2024",
   views: 920,
  },
  {
   id: "9",
   title: "Serverless IoT Data Pipeline",
   description:
    "Cloud-native architecture for processing IoT sensor data at scale.",
   category: "Cloud",
   university: "Georgia Tech",
   members: 2,
   publishDate: "Nov 14, 2024",
   views: 680,
  },
 ];

 const filteredProjects = allProjects.filter((project) => {
  const matchesSearch =
   project.title.toLowerCase().includes(searchQuery.toLowerCase()) ||
   project.description.toLowerCase().includes(searchQuery.toLowerCase());
  const matchesCategory =
   selectedCategory === "all" || project.category === selectedCategory;
  return matchesSearch && matchesCategory;
 });

 return (
  <div className="min-h-screen flex flex-col">
   <Navbar />

   <main className="flex-1">
    {/* Header */}
    <section className="gradient-hero border-b py-16">
     <div className="container">
      <h1 className="text-4xl md:text-5xl font-bold mb-4">
       Discover{" "}
       <span className="bg-gradient-to-r from-primary to-accent bg-clip-text text-transparent">
        Student Projects
       </span>
      </h1>
      <p className="text-lg text-muted-foreground max-w-2xl">
       Browse innovative projects from students across universities worldwide.
       Filter by category, search by keywords, and discover groundbreaking work.
      </p>
     </div>
    </section>

    {/* Filters */}
    <section className="py-8 border-b bg-muted/30">
     <div className="container">
      <div className="flex flex-col md:flex-row gap-4">
       <div className="flex-1 relative">
        <Search className="absolute left-3 top-1/2 -translate-y-1/2 h-4 w-4 text-muted-foreground" />
        <Input
         placeholder="Search projects..."
         value={searchQuery}
         onChange={(e) => setSearchQuery(e.target.value)}
         className="pl-10"
        />
       </div>

       <Select value={selectedCategory} onValueChange={setSelectedCategory}>
        <SelectTrigger className="w-full md:w-[200px]">
         <Filter className="h-4 w-4 mr-2" />
         <SelectValue placeholder="Category" />
        </SelectTrigger>
        <SelectContent>
         <SelectItem value="all">All Categories</SelectItem>
         <SelectItem value="AI">AI</SelectItem>
         <SelectItem value="Blockchain">Blockchain</SelectItem>
         <SelectItem value="Cloud">Cloud</SelectItem>
        </SelectContent>
       </Select>
      </div>

      <div className="mt-4 text-sm text-muted-foreground">
       Showing {filteredProjects.length} of {allProjects.length} projects
      </div>
     </div>
    </section>

    {/* Projects Grid */}
    <section className="py-12">
     <div className="container">
      {filteredProjects.length > 0 ? (
       <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-6">
        {filteredProjects.map((project) => (
         <ProjectCard key={project.id} {...project} />
        ))}
       </div>
      ) : (
       <div className="text-center py-12">
        <p className="text-muted-foreground">
         No projects found matching your criteria.
        </p>
        <Button
         onClick={() => {
          setSearchQuery("");
          setSelectedCategory("all");
         }}
         className="mt-4">
         Clear Filters
        </Button>
       </div>
      )}
     </div>
    </section>
   </main>

   <Footer />
  </div>
 );
};

export default Projects;
